The [@OnRemoved] annotation is used to mark a function
as event handler for the onRemoved event of a module.

example usage:

    @OnRemoved
    void onRemovedEventHandler() { ... }

Annotation which marks a function
as init function of a module. A module
must contain one init function.
In addition an init function is just
invoked once when the module is initialized
on application start.

example usage:

    @OnInit
    void init(ModuleContext context, InitEventArgs args) {
        //do something important
    }

The [@OnBeforeRemove] annotation is used to mark a function
as event handler for the onBeforeRemove event of a module.

example usage:

    @OnBeforeRemove
    void onBeforeRemoveEventHandler() { ... }

The [@OnBeforeAdd] annotation is used to mark a function
as event handler for the onBeforeAdd event of a module.

example usage:

    @OnBeforeAdd
    void onBeforeAddEventHandler() { ... }

The [@OnAdded] annotation is used to mark a function
as event handler for the onAdded event of a module.

example usage:

    @OnAdded
    void onAddedEventHandler() { ... }

The [@OnRequestCompleted] annotation is used to mark a function
as event handler for the onRequestCompleted event of a module.

example usage:

    //Is invoked when any request is completed with and without error
    @OnRequestCompleted()
    void onRequestCompletedEventHandler(RequestCompletedEventArgs args) { ... }

    //Is invoked when the request with the ID "news" is completed without error
    @OnRequestCompleted(requestId: "news")
    void onNewsRequestCompletedEventHandler(RequestCompletedEventArgs args) { ... }

    //Is invoked when the request with the ID "news" is completed with error
    @OnRequestCompleted(requestId: "news", isErrorHandler: true)
    void onNewsRequestErrorEventHandler(RequestCompletedEventArgs args) { ... }

The [@OnLoadingStateChanged] annotation is used to mark a function
as event handler for the onLoadingStateChanged event of a module.

example usage:

    //is invoked when the app starts or stops to load
    @OnLoadingStateChanged()
    void onLoadingStateChangedEventHandler(LoadingStateChangedEventArgs args) { ... }

    //is just invoked when the app starts to load
    @OnLoadingStateChanged(isLoading: true)
    void onLoadingStartedEventHandler(LoadingStateChangedEventArgs args) { ... }

    //is just invoked when the app stops to load
    @OnLoadingStateChanged(isLoading: false)
    void onLoadingStoppedEventHandler(LoadingStateChangedEventArgs args) { ... }

Annotation which marks a class as module.
Each module requires a version number with
the following pattern: "{int}.{int}.[int}"
like "1.0.0".

example usage:

    @Module("1.0.0")
    class ExampleModule { ... }

    @Module("1.0.0",
        author: "Author name",
        company: "Company name",
        eMail: "example@email.com",
        website: "http://www.example.com")
    class ExampleModuleWithOptionalAuthorInfo { ... }
